import { UsuarioService } from '../usuario.service';
import { Component, OnInit } from '@angular/core';
import { Usuario } from '../usuario';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-update-usuario',
  templateUrl: './update-usuario.component.html',
  styleUrls: ['./update-usuario.component.css']
})



export class UpdateUsuarioComponent implements OnInit {

 id!: number;
 usuario: Usuario = new Usuario();

  constructor(private usuarioService: UsuarioService,
    private router: Router,
    private route: ActivatedRoute) {}



  ngOnInit(): void {

    this.id = this.route.snapshot.params['id'];
    this.usuarioService.getUsuarioByid(this.id).subscribe({
      next: (data: Usuario) => {
        console.log(data)
        this.usuario = data
      },
      error: (error: any) => console.log(error),
      complete: () => console.log("Data init comepleted!")
    })

}

onSubmit() {
  this.updateUsuario();
}
updateUsuario() {
  this.usuarioService.updateUsuario(this.id, this.usuario)
  .subscribe({
    next: (data: any) => console.log(data),
    error: (error: any) => console.log(error),
    complete: () => this.goToUsuarioList()
  })
}
goToUsuarioList() {
  this.router.navigate(['/usuario-list'])}
}
<div class="col-md-6 offset-md-3">
    <h3 class="cor"> Atualizar Usuário </h3>
    <form (ngSubmit) = "onSubmit()">

        <div class="form-group">
            <label class="cor"> Login: </label>
            <input type="text" class ="form-control" id = "login"
                [(ngModel)] = "usuario.login" name = "login">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Senha: </label>
            <input type="text" class ="form-control" id = "senha"
                [(ngModel)] = "usuario.senha" name = "senha">
        </div>
        <div > </div>
        <div class="form-group">
            <label class="cor"> Nome: </label>
            <input type="text" class ="form-control" id = "nome"
                [(ngModel)] = "usuario.nome" name = "nome">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Ativo: </label>
            <input type="text" class ="form-control" id = "ativo"
                [(ngModel)] = "usuario.ativo" name = "ativo">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Data de Nascimento: </label>
            <input type="text" class ="form-control" id = "dataNascimento"
                [(ngModel)] = "usuario.dataNascimento" name = "dataNascimento">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Data de Cadastro: </label>
            <input type="text" class ="form-control" id = "dataCadastro"
                [(ngModel)] = "usuario.dataCadastro" name = "dataNascimento">
        </div>
        <div> </div>
        <button class = "btn btn-success" (click)="updateUsuario()">Atualizar Militar</button>



    </form>
    </div>
